import axios from 'axios';
import React, { useContext, useEffect, useState } from 'react';
import { Link, useParams } from 'react-router-dom';
import { Toggle } from '../user/Toggle';
import AppContext from '../Context/Context';

export default function Home({selectedCategory}) {
  const [product, setProduct] = useState([]);
  const [isErrors, setIsError] = useState(false);
  const { id } = useParams();
  const { data, isError, addToCart, refreshData } = useContext(AppContext);
  const [imageUrls, setImageUrls] = useState({});
  const[isDark,isSetDark]=useState(true);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get("http://localhost:8080/product");
        setProduct(response.data);
        console.log(response.data);

        const imageResponsePromises = response.data.map(async (product) => {
          const imageResponse = await axios.get(`http://localhost:8080/product/${product.id}/image`, { responseType: 'arraybuffer' });
          const blob = new Blob([imageResponse.data], { type: imageResponse.headers['content-type'] });
          const url = URL.createObjectURL(blob);
          setImageUrls(prevImageUrls => ({
            ...prevImageUrls,
            [product.id]: url
          }));
        });

        await Promise.all(imageResponsePromises);
      } catch (error) {
        setIsError(true);
        console.error('Error fetching data:', error);
      }
    };
    fetchData();
  }, []);

  if (isErrors) {
    return <div className="alert alert-danger">There was an error fetching the products.</div>;
  }

    const filteredProducts=selectedCategory?product.filter((product)=>product.category===selectedCategory)
    :product;

  return (
    <>
          <div className="grid">
        {filteredProducts.length === 0 ? (
          <h2
            className="text-center"
            style={{
              display: "flex",
              justifyContent: "center",
              alignItems: "center",
            }}
          >
            No Products Available
          </h2>
        ) : (
          filteredProducts.map((product) => {
            const { id, brand, name, price, available, imageUrl } =
              product;
            const cardStyle = {
              width: "18rem",
              height: "12rem",
              boxShadow: "rgba(0, 0, 0, 0.24) 0px 2px 3px",
              backgroundColor: available ? "#fff" : "#ccc",
            };
            return (
              <div
                className="card mb-3"
                style={{
                  width: "18rem",
                  height: "24rem",
                  boxShadow: "rgba(0, 0, 0, 0.24) 0px 2px 3px",
                  backgroundColor: available ? "#fff" : "#ccc",
                  margin: "10px",
                  display: "flex",
                  flexDirection: "column",
                }}
                key={id}
              >
                <Link
                  to={`/product/${id}`}
                  style={{ textDecoration: "none", color: "inherit" }}
                >
                  <img
                    src={imageUrl}
                    alt={name}
                    style={{
                      width: "100%",
                      height: "180px",
                      objectFit: "cover",
                      padding: "5px",
                      margin: "0",
                    }}
                  />
                  <div
                    className="buttons"
                    style={{
                      position: "absolute",
                      top: "25px",
                      left: "220px",
                      zIndex: "1",
                      
                    }}
                  >
                    <div className="buttons-liked">
                      <i className="bi bi-heart"></i>
                    </div>
                  </div>
                  <div
                    className="card-body"
                    style={{
                      flexGrow: 1,
                      display: "flex",
                      flexDirection: "column",
                      justifyContent: "space-between",
                      padding: "10px",
                    }}
                  >
                    <div>
                      <h5
                        className="card-title"
                        style={{ margin: "0 0 10px 0" }}
                      >
                        {name.toUpperCase()}
                      </h5>
                      <i className="card-brand" style={{ fontStyle: "italic" }}>
                        {"~ " + brand}
                      </i>
                    </div>
                    <div>
                      <h5
                        className="card-text"
                        style={{ fontWeight: "600", margin: "5px 0" }}
                      >
                        {"$" + price}
                      </h5>
                      <button
                        className="btn btn-primary"
                        style={{ width: "100%" }}
                        onClick={(e) => {
                          e.preventDefault();
                          addToCart(product);
                        }}
                        disabled={!productAvailable}
                      >
                        {productAvailable ? "Add to Cart" : "Out of Stock"}
                      </button>
                    </div>
                  </div>
                </Link>
              </div>
            );
          })
        )}
      </div>

</>
  );
}
